import {Injectable} from '@angular/core';
import {Observable, Subject} from "rxjs";
import {cloneDeep} from 'lodash';

@Injectable({
  providedIn: 'root'
})
export class HybridService {

  private hybridsChanged = new Subject<void>();

  private hybridsSummaryPath = '/hybrid/summary';
  private hybridsEditPath = '/hybrid/edit';
  private hybridsViewPath = '/hybrids/view';
  private hybridsRootPath = this.hybridsSummaryPath;

  private hybrids = [
    {
      id: 1,
      code: '19001',
      mother: {
        id: 0,
        code: '',
      },
      father: {
        id: 0,
        code: '',
      },
      description: 'Nommer 19001',
      seed: 'seed-none',
      offspring: 'offspring',
      image: '',
      comment: '',
    },
    {
      id: 2,
      code: '19002',
      mother: {
        id: 0,
        code: '',
      },
      father: {
        id: 0,
        code: '',
      },
      description: 'Nommer 19002',
      seed: 'seed',
      offspring: 'offspring',
      image: '',
      comment: '',
    },
    {
      id: 3,
      code: '19003',
      mother: {
        id: 1,
        code: '19001',
      },
      father: {
        id: 2,
        code: '19002',
      },
      description: 'Nommer 19003 (19001 x 19002)',
      seed: 'seed-dull',
      offspring: 'offspring-none',
      image: '',
      comment: '',
    },
  ]

  constructor() {
    this.initHybrids();
  }

  getHybridsSummaryPath() {
    return this.hybridsSummaryPath;
  }

  getHybridEditPath() {
    return this.hybridsEditPath;
  }

  getHybridsChanged(): Observable<void> {
    return this.hybridsChanged.asObservable();
  }

  getHybrids() {
    return this.hybrids.slice();
  }

  getHybrid(id: number) {
    let hybrid = {};
    if (id > 0) {
      hybrid = this.lookupHybridById(id);
    }
    return cloneDeep(hybrid);
  }

  setHybrid(hybrid: any): boolean {
    let newHybrid: any;
    let existingHybrid: any;

    if (hybrid.id > 0) {
      existingHybrid = this.lookupHybridById(hybrid.id);
    }

    newHybrid = {
      id: hybrid.id,
      code: hybrid.code ? hybrid.code : '',
      mother: hybrid.mother ? this.lookupHybridByCode(hybrid.mother) : '',
      father: hybrid.father ? this.lookupHybridByCode(hybrid.father) : '',
      description: hybrid.description ? hybrid.description : '',
      seed: hybrid.seed ? hybrid.seed : '',
      offspring: hybrid.offspring ? hybrid.offspring : '',
      image: hybrid.image ? hybrid.image : '',
      comment: hybrid.comment ? hybrid.comment : ''
    }

    if (existingHybrid) {
      this.hybrids.splice(this.hybrids.indexOf(existingHybrid), 1, newHybrid)
    } else {
      this.hybrids.push(hybrid);
    }

    this.hybridsChanged.next();
    return true;
  }

  private lookupHybridById(id: number) {
    return this.hybrids.find(it => it.id == id);
  }

  private lookupHybridByCode(code: string) {
    return this.hybrids.find(it => it.code == code);
  }

  private initHybrids(): void {
    let hybrid: any;
    hybrid = this.lookupHybridById(2);
    hybrid.image =
      'data:image/jpg;base64,';
  }
}
